function trimValue(value) {
    var temp = value
    var obj = /^(\s*)([\W\w]*)(\b\s*$)/
    if (obj.test(temp)) {
        temp = temp.replace(obj, '$2')
    }
    var obj = / +/g
    temp = temp.replace(obj, ' ')
    if (temp == ' ') {
        temp = ''
    }
    temp = temp.replace(/\n/g, ' ')
    temp = temp.replace(/\s/g, ' ')
    return temp
}

