function sc_device_sort_asc(a, b) {
    if (a.deviceName > b.deviceName) {
        return 1
    }
    if (a.deviceName < b.deviceName) {
        return -1
    }
    return 0
}

function sc_device_sort_desc(a, b) {
    if (a.deviceName > b.deviceName) {
        return -1
    }
    if (a.deviceName < b.deviceName) {
        return 1
    }
    return 0
}

